package ra.dev.model.dto.request.product;import lombok.Getter;import lombok.NoArgsConstructor;import lombok.Setter;@Getter@Setter@NoArgsConstructorpublic class ProductGet {    private Integer productId;    private String catalogName;    private String productName;    private Integer discount;    private Integer price;    private Boolean prodcutStatus;    private String productImg;    public ProductGet(Integer productId, String catalogName , String productName, Integer discount, Integer price, Boolean prodcutStatus, String productImg) {        this.productId = productId;        this.discount = discount;        this.price = price;        this.productName = productName;        this.prodcutStatus = prodcutStatus;        this.catalogName = catalogName;        this.productImg = productImg;    }}